import React from 'react'
import {
    Switch,
    Route,
} from "react-router-dom";

export default function SwitchComp() {
    return (
        <Switch>
            <Route path="/contentdata">
                <ContentData />
            </Route>
            <Route path="/users">
                <Users />
            </Route>
            <Route path="/">
                <Home />
            </Route>
        </Switch>
    )
}

function Home() {
    return <h2>ContentData</h2>;
}
function ContentData() {
    return <h2>ContentData</h2>;
}

function Comment() {
    return <h2>Comment</h2>;
}

function Contact() {
    return <h2>Contact</h2>;
}
function ErrorCatch() {
    return <h2>ErrorCatch</h2>;
}
function User() {
    return <h2>User</h2>;
}
